import{_ as t,a as o,b as s,c as r}from"./chunks/subset_formula.BUGDK4kU.js";import{_ as i}from"./chunks/exploration.CM6l5miE.js";import{_ as n}from"./chunks/data_upload.BprzPkGi.js";import{a as l,_ as m}from"./chunks/tm1datacompare_result.DrjEBd-H.js";import{_ as c}from"./chunks/process_screen.Dh0uKR30.js";import{_ as d}from"./chunks/processes.CJC4zvyO.js";import{_ as u,a as h}from"./chunks/code_prolog.CmozwF34.js";import{d as p,a as g,_ as f,b,e as y,f as _,c as q}from"./chunks/security_tracer.QpGm4qPX.js";import{_ as a,a as x}from"./chunks/processes.D-cid1Vn.js";import{_ as T,a as M,b as P}from"./chunks/audit_log.Ce9Mrygj.js";import{_ as w,c as k,o as A,ag as v}from"./chunks/framework.BG_SpCm2.js";const I="/teamone/img/tasks/tm1datacompare.png",B="/teamone/img/functions/code_element_security_expressions.png",S="/teamone/img/tm1/TI_console.png",J=JSON.parse('{"title":"TeamOne","titleTemplate":"Features","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Features"},"headers":[],"relativePath":"features.md","filePath":"features.md"}'),D={name:"features.md"};function O(E,e,z,L,U,N){return A(),k("div",null,e[0]||(e[0]=[v('<h1 id="teamone-feature-list" tabindex="-1">TeamOne Feature List <a class="header-anchor" href="#teamone-feature-list" aria-label="Permalink to &quot;TeamOne Feature List&quot;">​</a></h1><p>This page provides an overview of the main features of TeamOne, along with brief explanations. For more details and live examples, please refer to the <a href="./doc/">TeamOne documentation</a>.</p><h2 id="querying-ibm-pa-data" tabindex="-1">Querying IBM PA Data <a class="header-anchor" href="#querying-ibm-pa-data" aria-label="Permalink to &quot;Querying IBM PA Data&quot;">​</a></h2><p>TeamOne offers several ways to bring IBM Planning Analytics (PA) data directly into Google Sheets:</p><h3 id="teamone-formula" tabindex="-1">=TEAMONE() formula <a class="header-anchor" href="#teamone-formula" aria-label="Permalink to &quot;=TEAMONE() formula&quot;">​</a></h3><p>The <a href="./doc/formulas.html#teamone-function">=TEAMONE()</a> formula is the simplest and fastest way to query IBM PA data without requiring technical expertise. You don’t need to specify IBM PA dimension or hierarchy names, nor do you have to define all dimensions explicitly. With just one formula, you can retrieve an entire data slice efficiently.</p><p><img src="'+t+'" alt="img" data-zoomable=""></p><h3 id="mdx-formula" tabindex="-1">=MDX() formula <a class="header-anchor" href="#mdx-formula" aria-label="Permalink to &quot;=MDX() formula&quot;">​</a></h3><p>The <a href="./doc/formulas.html#mdx-function">=MDX()</a> formula lets you create reports with dynamic rows and columns. When used with other TeamOne functions, it enables you to build advanced reports and dashboards of any complexity.</p><p><img src="'+o+'" alt="img" data-zoomable=""></p><h3 id="attr-formula" tabindex="-1">=ATTR() formula <a class="header-anchor" href="#attr-formula" aria-label="Permalink to &quot;=ATTR() formula&quot;">​</a></h3><p>Using the <a href="./doc/formulas.html#attr-function">=ATTR()</a> function you can easily retrieve dimension element attributes:</p><p><img src="'+s+'" alt="img" data-zoomable=""></p><h3 id="subset-formula" tabindex="-1">=SUBSET() formula <a class="header-anchor" href="#subset-formula" aria-label="Permalink to &quot;=SUBSET() formula&quot;">​</a></h3><p>Using the <a href="./doc/formulas.html#subset-function">=SUBSET()</a> function you can query IBM PA dimension elements and use them to create picklists in Google Sheets:</p><p><img src="'+r+'" alt="img" data-zoomable=""></p><h3 id="explorations" tabindex="-1">Explorations <a class="header-anchor" href="#explorations" aria-label="Permalink to &quot;Explorations&quot;">​</a></h3><p><a href="./doc/explorer.html">TeamOne Explorations</a> bring cube views directly into Google Sheets. Similar to IBM Planning Analytics Workspace, you can use the TeamOne sidebar UI to browse and select dimension elements, as well as refresh data seamlessly within the sheet grid.</p><p><img src="'+i+'" alt="img"></p><h3 id="mdx-mods" tabindex="-1">MDX Mods <a class="header-anchor" href="#mdx-mods" aria-label="Permalink to &quot;MDX Mods&quot;">​</a></h3><p>MDX can be complex, which is why we introduced <a href="./doc/functions.html#mdx-mods">MDX mods</a>—simplified expressions that make it easier to create dynamic subsets. You can use them in the <a href="./doc/formulas.html#subset-function">=SUBSET()</a> and <a href="./doc/formulas.html#mdx-function">=MDX()</a> functions, as well as in <a href="./doc/explorer.html">TeamOne Explorations</a>.</p><p>For example, compare this traditional MDX expression:</p><p><code>{FILTER( {TM1FILTERBYLEVEL( {TM1DRILLDOWNMEMBER( {[Period].[Period].[FY2026]}, ALL )}, 0 )}, [Period].[Period].[quarter] = &quot;Q3&quot; )}</code></p><p>with the equivalent, much simpler MDX mod:</p><p><code>FY2026&gt;&gt;expand&gt;&gt;level=0&gt;&gt;quarter=Q3</code></p><p>MDX mods also support wildcard expressions:</p><p><code>FY20*&gt;&gt;descendants&gt;&gt;level=0&gt;&gt;status=OP?N&gt;&gt;first=5</code></p><h2 id="writing-data-back-to-ibm-pa" tabindex="-1">Writing Data Back to IBM PA <a class="header-anchor" href="#writing-data-back-to-ibm-pa" aria-label="Permalink to &quot;Writing Data Back to IBM PA&quot;">​</a></h2><p>Both the <a href="./doc/formulas.html#teamone-function">=TEAMONE()</a> function and <a href="./doc/explorer.html">Explorations</a> support data write-back. To enable this feature, simply add the <a href="./doc/formulas.html#update-mode">&quot;U&quot; flag</a> in the <em>=TEAMONE()</em> formula or enable <a href="./doc/explorer.html#allow-data-updates">Allow Data Updates</a> in Explorations. This allows you to upload data from Google Sheets to IBM PA with a single click.</p><p><img src="'+n+'" alt="img" data-zoomable=""></p><h2 id="comparing-data" tabindex="-1">Comparing Data <a class="header-anchor" href="#comparing-data" aria-label="Permalink to &quot;Comparing Data&quot;">​</a></h2><p>The <a href="./doc/tasks.html#tm1datacompare">tm1datacompare</a> task allows you to compare the results of an existing <a href="./doc/tasks.html#tm1data">tm1data</a> task query, whether it&#39;s a cube view, an MDX query, or a set of specified dimension elements/subset, across the same or different IBM Planning Analytics environments.</p><p><img src="'+I+'" alt="img" data-zoomable=""></p><p>A common use case is identifying data discrepancies, such as comparing &quot;Before vs. After&quot; a release deployment or analyzing differences between two cubes within the same or different environments.</p><p><img src="'+l+'" alt="img" data-zoomable=""></p><h2 id="automating-things" tabindex="-1">Automating things <a class="header-anchor" href="#automating-things" aria-label="Permalink to &quot;Automating things&quot;">​</a></h2><h3 id="ibm-pa-processes" tabindex="-1">IBM PA processes <a class="header-anchor" href="#ibm-pa-processes" aria-label="Permalink to &quot;IBM PA processes&quot;">​</a></h3><p>Using TeamOne you can see and run IBM Planning Analytics processes directly from Google Sheets:</p><p><img src="'+c+'" alt="img" data-zoomable=""></p><p>Additionally you can:</p><ul><li>execute processes and chores</li><li>rename or delete processes</li><li>compare and deploy code between environments</li><li>create automated tasks</li></ul><h3 id="tm1process-task" tabindex="-1">tm1process Task <a class="header-anchor" href="#tm1process-task" aria-label="Permalink to &quot;tm1process Task&quot;">​</a></h3><p>The <a href="./doc/tasks.html#tm1process">tm1process</a> task allows you to run TurboIntegrator processes with flexibility to define process names, parameters, and values directly within Google Sheets. By combining multiple tasks, you can create one-click automations for various IBM Planning Analytics routines.</p><p><img src="'+m+'" alt="img" data-zoomable=""></p><h2 id="ibm-pa-model-management" tabindex="-1">IBM PA model management <a class="header-anchor" href="#ibm-pa-model-management" aria-label="Permalink to &quot;IBM PA model management&quot;">​</a></h2><h3 id="model-search" tabindex="-1">Model Search <a class="header-anchor" href="#model-search" aria-label="Permalink to &quot;Model Search&quot;">​</a></h3><p>Use the <a href="./doc/search.html#searching">Model Search</a> to search across cubes, processes, and chores:</p><p><img src="'+d+'" alt="img" data-zoomable=""></p><h3 id="sync-cubes-and-dimensions-from-google-sheets" tabindex="-1">Sync cubes and dimensions from Google Sheets <a class="header-anchor" href="#sync-cubes-and-dimensions-from-google-sheets" aria-label="Permalink to &quot;Sync cubes and dimensions from Google Sheets&quot;">​</a></h3><p>With TeamOne, you can create, update, and localize IBM Planning Analytics <a href="./doc/functions.html#cube">cubes</a>, <a href="./doc/functions.html#view">views</a>, <a href="./doc/functions.html#dimension">dimensions, hierarchies, elements, attributes</a>, and <a href="./doc/functions.html#subset">subsets</a> — all without writing a single line of code.</p><p><img src="'+u+'" alt="img"></p><h3 id="user-and-group-management" tabindex="-1">User and group management <a class="header-anchor" href="#user-and-group-management" aria-label="Permalink to &quot;User and group management&quot;">​</a></h3><p>You can manage all your users and groups on a single sheet and TeamOne can sync it automatically with IBM PA server: <img src="'+p+'" alt="img" data-zoomable=""></p><p>For existing models TeamOne can genegate such <a href="./doc/users.html#security-sheet">security sheet*** </a> for you and populate it with the existing users and groups.</p><p>Or you can edit users manually: <img src="'+g+'" alt="img" data-zoomable=""></p><p>You can see who is online, disable, enable, log off and delete users: <img src="'+f+'" alt="img" data-zoomable=""></p><p>You can even copy security groups between users: <img src="'+b+'" alt="img" data-zoomable=""></p><p>Use integrated <a href="./doc/users.html#tm1-top">TM1 top*** </a> console to see what exactly is happening and cancel user session threads: <img src="'+y+'" alt="img" data-zoomable=""></p><h3 id="object-security" tabindex="-1">Object security <a class="header-anchor" href="#object-security" aria-label="Permalink to &quot;Object security&quot;">​</a></h3><p>You can define/document object security directly in Sheets, including <a href="./doc/functions.html#cube-security">cube security*** </a>, <a href="./doc/functions.html#dimension-security">dimension security*** </a>, <a href="./doc/functions.html#element-security">element security*** </a>, <a href="./doc/functions.html#application-security">application security*** </a>, <a href="./doc/functions.html#process-security">process security*** </a>.</p><p>You can define IBM Planning Analytics objects on the rows and security groups on the columns. You can use one object per row or comma delimited list, or wildcard expression or MDX mods or real MDX or even mix all together: <img src="'+B+'" alt="img" data-zoomable=""></p><h3 id="ibm-planning-analytics-code" tabindex="-1">IBM Planning Analytics code <a class="header-anchor" href="#ibm-planning-analytics-code" aria-label="Permalink to &quot;IBM Planning Analytics code&quot;">​</a></h3><p>Write and execute TI code directly in Google Sheets: <img src="'+h+'" alt="img" data-zoomable=""></p><p>Or use the built-in TM1 console: <img src="'+S+'" alt="img" data-zoomable=""></p><h3 id="compare-models" tabindex="-1">Compare Models <a class="header-anchor" href="#compare-models" aria-label="Permalink to &quot;Compare Models&quot;">​</a></h3><p>The <a href="./doc/compare.html">Model Compare</a> screen allows you to compare two IBM PA servers side by side:</p><p><img src="'+a+'" alt="img" data-zoomable=""></p><p>You can view the exact differences in models, including processes, chores, rules, views and subsets:</p><p><img src="'+x+'" alt="img" data-zoomable=""></p><h3 id="deployments" tabindex="-1">Deployments <a class="header-anchor" href="#deployments" aria-label="Permalink to &quot;Deployments&quot;">​</a></h3><p>Easily select and promote multiple objects between environments in both directions:</p><p><img src="'+a+'" alt="img" data-zoomable=""></p><h2 id="view-server-logs" tabindex="-1">View Server Logs <a class="header-anchor" href="#view-server-logs" aria-label="Permalink to &quot;View Server Logs&quot;">​</a></h2><h3 id="message-log" tabindex="-1">Message Log <a class="header-anchor" href="#message-log" aria-label="Permalink to &quot;Message Log&quot;">​</a></h3><p>On the <em><strong>Logs</strong></em> tab, ADMIN users can view and search the IBM PA server message log. Use the filter button to refine records by date or specific keywords.</p><p><img src="'+T+'" alt="img" data-zoomable=""></p><h3 id="transaction-log" tabindex="-1">Transaction Log <a class="header-anchor" href="#transaction-log" aria-label="Permalink to &quot;Transaction Log&quot;">​</a></h3><p>Accessible to ADMIN users from the sidebar menu, the <em><strong>Transaction Log</strong></em> viewer allows you to search and filter IBM PA server transaction records. Use the query button to filter records by cube, user, elements, and time period.</p><p><img src="'+M+'" alt="img" data-zoomable=""></p><h3 id="audit-log" tabindex="-1">Audit Log <a class="header-anchor" href="#audit-log" aria-label="Permalink to &quot;Audit Log&quot;">​</a></h3><p>Available to ADMIN users from the sidebar menu, the <em><strong>Audit Log</strong></em> viewer enables you to search and analyze IBM PA server audit records. Use the query button to filter records by user, object type, description, and time period.</p><p><img src="'+P+'" alt="img" data-zoomable=""></p><h2 id="troubleshoot-security-issues" tabindex="-1">Troubleshoot Security Issues <a class="header-anchor" href="#troubleshoot-security-issues" aria-label="Permalink to &quot;Troubleshoot Security Issues&quot;">​</a></h2><h3 id="security-tracer" tabindex="-1">Security Tracer <a class="header-anchor" href="#security-tracer" aria-label="Permalink to &quot;Security Tracer&quot;">​</a></h3><p>With the <a href="./doc/users.html#security-tracer">Security Tracer</a> in TeamOne, ADMIN users can quickly and easily diagnose user access issues, providing a comprehensive view of cube, dimension, hierarchy, element, and data security.<br> Simply select a user and a cube cell, and TeamOne will display and explain the user&#39;s security level.</p><p><img src="'+_+'" alt="img"></p><h3 id="user-impersonation" tabindex="-1">User Impersonation <a class="header-anchor" href="#user-impersonation" aria-label="Permalink to &quot;User Impersonation&quot;">​</a></h3><p>ADMIN users can also <a href="./doc/users.html#impersonating-users">impersonate</a> other users to troubleshoot access issues firsthand.</p><p><img src="'+q+'" alt="img"></p>',89)]))}const H=w(D,[["render",O]]);export{J as __pageData,H as default};
